import React from "react";
import { StyleSheet, View, Text } from "react-native";

function MenuBar(props) {
  return (
    <View style={styles.menuBar}>
      <Text>Hi there</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  menuBar: {
    backgroundColor: "#fff",
    height: "10%",
    alignItems: "stretch",
  },
});

export default MenuBar;
